import React, { useState } from 'react';
import './HomePage.scss';

const initialImages = [
  './img/slider/1.jpg',
  './img/slider/2.jpg',
  './img/slider/3.jpg',
  './img/slider/4.jpg',
  './img/slider/5.jpg',
  './img/slider/6.jpg',
];


export const HomePage = () => {
  const [images, setImages] = useState(initialImages);

  return (
    <div className="HomePage">
      <div className="ProductsSlider">
        <div className="ProductsSlider-Container">
          <ul className="ProductsSlider-List">
            {images.map(image => (
              <li className="ProductsSlider-Item" key={image}
              >
                <img
                src={image}
                alt={image}

              />

              </li>
            ))}

          </ul>

        </div>

      </div>

    </div>
  )
}
